import React from 'react';
import { Link } from 'react-router-dom'

const Nav = () => {



  return (
    <nav>
      <ul>
        <Link to="/">
          <li>Home</li>
        </Link>

        <Link to="/basket">
          <li>Basket</li>
        </Link>

        <Link to="/contact">
          <li>Contact</li>
        </Link>

      </ul>
    </nav>
  )
}

export default Nav;
